import React from 'react';
import ArchivioCard from '../molecules/ArchivioCard';

const colSpanClasses = {
  1: 'md:col-span-1',
  2: 'md:col-span-2',
  3: 'md:col-span-3',
  4: 'md:col-span-4',
  5: 'md:col-span-5',
  6: 'md:col-span-6',
};

function ArchivioGrid() {
  return (
    <div className='px-4 grid grid-cols-6 gap-4 h-fit w-full'>
      <div className={`col-span-full ${colSpanClasses[3]} flex flex-col gap-4`}>
        <ArchivioCard url="https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6550d170d6f9d81d70b1d7ce_Alexis%20Bardini%20FABA%20Speaker.webp" desc="Second Item in the Same Column"/>
      </div>
      <div className={`col-span-full ${colSpanClasses[1]} flex flex-col gap-4`}>
        <ArchivioCard url="https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6550d170d6f9d81d70b1d7ce_Alexis%20Bardini%20FABA%20Speaker.webp" desc="NUCLEAR WEAPONS EFFECTS COMPUTER / NO. 1 / 1960"/>
        <ArchivioCard url="https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6550d170d6f9d81d70b1d7ce_Alexis%20Bardini%20FABA%20Speaker.webp" desc="Another Item in the Same Column"/>
      </div>
      <div className={`col-span-full ${colSpanClasses[1]}`}>
        <ArchivioCard url="https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6550d170d6f9d81d70b1d7ce_Alexis%20Bardini%20FABA%20Speaker.webp" desc="Single Item in This Column"/>
      </div>
      <div className={`col-span-full ${colSpanClasses[1]} flex flex-col gap-4`}>
        <ArchivioCard url="https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6550d170d6f9d81d70b1d7ce_Alexis%20Bardini%20FABA%20Speaker.webp" desc="First Item in the Last Column"/>
        <ArchivioCard url="https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6550d170d6f9d81d70b1d7ce_Alexis%20Bardini%20FABA%20Speaker.webp" desc="Second Item in the Last Column"/>
      </div>
    </div>
  );
}

export default ArchivioGrid;
